<!doctype html>
<html>
<head>
  <meta charset="utf-8"/>
  <meta name="viewport" content="width=device-width, initial-scale=1"/>
  <title>Single-nucleus Gene Explorer</title>
  <script src="https://cdn.plot.ly/plotly-2.27.0.min.js"></script>
  <style>
    body { margin: 0; font-family: system-ui, -apple-system, Segoe UI, Roboto, Arial; background: #fff; }
    .wrap { display: grid; grid-template-columns: 1fr 360px; gap: 18px; padding: 18px; }
    .card { background: #fff; border: 1px solid #e8e8e8; border-radius: 14px; box-shadow: 0 1px 8px rgba(0,0,0,0.04); }
    #plot { height: 860px; }
    .side { padding: 14px 14px 18px; }
    h2 { margin: 6px 0 12px; font-size: 18px; }
    label { display:block; font-size: 12px; color:#444; margin-top: 10px; margin-bottom: 6px; }
    input, select { width: 100%; padding: 10px; border-radius: 10px; border: 1px solid #ddd; font-size: 14px; }
    .btn { margin-top: 10px; width: 100%; padding: 10px; border-radius: 10px; border: 1px solid #111; background:#111; color:#fff; font-size: 14px; cursor: pointer; }
    .muted { color:#666; font-size: 12px; line-height: 1.35; margin-top: 10px; }
    .box { margin-top: 12px; padding: 10px; border-radius: 10px; background: #fafafa; border: 1px solid #eee; font-size: 12px; white-space: pre-wrap; }
  </style>
</head>
<body>
  <div class="wrap">
    <div class="card"><div id="plot"></div></div>
    <div class="card side">
      <h2>Gene Explorer (single page)</h2>

      <label>Gene (type to search)</label>
      <input id="geneInput" list="geneList" />
      <datalist id="geneList"></datalist>
      <button class="btn" id="applyBtn">Apply</button>

      <label>Broad Celltype</label>
      <select id="fltBroad"></select>

      <label>Cell subtype</label>
      <select id="fltSubtype"></select>

      <label>Spinal Region</label>
      <select id="fltRegion"></select>

      <label>Timepoint</label>
      <select id="fltTime"></select>

      <label>Condition</label>
      <select id="fltCond"></select>

      <div class="muted">
        Hover points to see metadata. Drag to select points; selection summary updates below.
        This page uses a subsample (6000 cells) for GitHub Pages.
      </div>

      <div class="box" id="selBox">Selection: none</div>
      <div class="box" id="infoBox"></div>
    </div>
  </div>

AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABA AEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAQABAAEAAQABAAEAAQABAAEAAQABAAEAAQAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA"}}};

function b64ToBytes(b64) {
  const bin = atob(b64);
  const len = bin.length;
  const bytes = new Uint8Array(len);
  for (let i=0; i<len; i++) bytes[i] = bin.charCodeAt(i);
  return bytes;
}
function b64ToUint16(b64) {
  return new Uint16Array(b64ToBytes(b64).buffer);
}
function b64ToFloat32(b64) {
  return new Float32Array(b64ToBytes(b64).buffer);
}

const x = b64ToFloat32(DATA.x_b64);
const y = b64ToFloat32(DATA.y_b64);

const cats = {};
for (const [k, v] of Object.entries(DATA.cats)) {
  cats[k] = { labels: v.labels, codes: b64ToUint16(v.codes_b64) };
}

function fillSelect(sel, labels) {
  sel.innerHTML = "";
  const opt0 = document.createElement("option");
  opt0.value = "__ALL__";
  opt0.textContent = "All";
  sel.appendChild(opt0);
  for (let i=0; i<labels.length; i++) {
    const o = document.createElement("option");
    o.value = String(i);
    o.textContent = labels[i];
    sel.appendChild(o);
  }
}

const geneList = document.getElementById("geneList");
DATA.genes.forEach(g => {
  const o = document.createElement("option");
  o.value = g;
  geneList.appendChild(o);
});

const geneInput = document.getElementById("geneInput");
geneInput.value = DATA.genes[0];

const fltBroad = document.getElementById("fltBroad");
const fltSubtype = document.getElementById("fltSubtype");
const fltRegion = document.getElementById("fltRegion");
const fltTime = document.getElementById("fltTime");
const fltCond = document.getElementById("fltCond");

fillSelect(fltBroad, cats["Broad Celltype"].labels);
fillSelect(fltSubtype, cats["Cell subtype"].labels);
fillSelect(fltRegion, cats["Spinal Region"].labels);
fillSelect(fltTime, cats["Timepoint"].labels);
fillSelect(fltCond, cats["Condition"].labels);

function currentFilters() {
  return {
    broad: fltBroad.value,
    subtype: fltSubtype.value,
    region: fltRegion.value,
    time: fltTime.value,
    cond: fltCond.value
  };
}

function passFilter(i, F) {
  if (F.broad !== "__ALL__" && cats["Broad Celltype"].codes[i] !== Number(F.broad)) return false;
  if (F.subtype !== "__ALL__" && cats["Cell subtype"].codes[i] !== Number(F.subtype)) return false;
  if (F.region !== "__ALL__" && cats["Spinal Region"].codes[i] !== Number(F.region)) return false;
  if (F.time !== "__ALL__" && cats["Timepoint"].codes[i] !== Number(F.time)) return false;
  if (F.cond !== "__ALL__" && cats["Condition"].codes[i] !== Number(F.cond)) return false;
  return true;
}

function decodeGeneU16(gene) {
  return b64ToUint16(DATA.gene_b64[gene]);
}

function label(catName, code) {
  const L = cats[catName].labels;
  const c = Number(code);
  if (Number.isNaN(c) || c < 0 || c >= L.length) return "NA";
  return L[c];
}

let geneU16 = decodeGeneU16(geneInput.value);

function buildPlot() {
  const F = currentFilters();
  const idx = [];
  for (let i=0; i<DATA.n; i++) {
    if (passFilter(i, F)) idx.push(i);
  }

  const invScale = 1.0 / DATA.scale;
  const Xp = new Array(idx.length);
  const Yp = new Array(idx.length);
  const Cp = new Array(idx.length);
  const CD = new Array(idx.length);

  for (let j=0; j<idx.length; j++) {
    const i = idx[j];
    Xp[j] = x[i];
    Yp[j] = y[i];
    Cp[j] = geneU16[i] * invScale;
    CD[j] = [
      label("Sample", cats["Sample"].codes[i]),
      label("Broad Celltype", cats["Broad Celltype"].codes[i]),
      label("Cell subtype", cats["Cell subtype"].codes[i]),
      label("Spinal Region", cats["Spinal Region"].codes[i]),
      label("Timepoint", cats["Timepoint"].codes[i]),
      label("Condition", cats["Condition"].codes[i]),
      label("Animal", cats["Animal"].codes[i]),
      label("Sex", cats["Sex"].codes[i]),
    ];
  }

  const trace = {
    type: "scattergl",
    mode: "markers",
    x: Xp,
    y: Yp,
    customdata: CD,
    marker: {
      size: 4,
      opacity: 0.95,
      color: Cp,
      colorscale: "Viridis",
      colorbar: { title: "log1p(expr)" },
      cmin: 0,
      cmax: DATA.clip_max
    },
    hovertemplate:
      "Sample: %{customdata[0]}<br>" +
      "Broad: %{customdata[1]}<br>" +
      "Subtype: %{customdata[2]}<br>" +
      "Region: %{customdata[3]}<br>" +
      "Time: %{customdata[4]}<br>" +
      "Cond: %{customdata[5]}<br>" +
      "Animal: %{customdata[6]}<br>" +
      "Sex: %{customdata[7]}<br>" +
      "UMAP1: %{x:.2f}<br>" +
      "UMAP2: %{y:.2f}<br>" +
      "Expr: %{marker.color:.3f}<extra></extra>"
  };

  const layout = {
    title: "UMAP colored by gene: " + geneInput.value + " (n=" + idx.length + " cells shown)",
    height: 860,
    margin: {l: 50, r: 20, t: 60, b: 50},
    xaxis: {title: "UMAP1"},
    yaxis: {title: "UMAP2"},
  };

  Plotly.newPlot("plot", [trace], layout, {displaylogo: false});
  document.getElementById("infoBox").textContent =
    "Gene panel = markers (by Broad Celltype mean on the displayed subsample) + top-by-mean overall. " +
    "Markers: " + DATA.genes_marker.length + ", Top-mean: " + DATA.genes_topmean.length +
    ", Total: " + DATA.genes.length + ".";
}

function updateSelectionSummary(eventData) {
  const box = document.getElementById("selBox");
  if (!eventData || !eventData.points || eventData.points.length === 0) {
    box.textContent = "Selection: none";
    return;
  }
  const pts = eventData.points;
  const counts = {};
  for (let k=0; k<pts.length; k++) {
    const broad = pts[k].customdata[1];
    counts[broad] = (counts[broad] || 0) + 1;
  }
  let s = "Selection: " + pts.length + " cells\n\nBroad Celltype counts:\n";
  const keys = Object.keys(counts).sort((a,b)=>counts[b]-counts[a]);
  keys.forEach(k => s += k + ": " + counts[k] + "\n");
  box.textContent = s;
}

document.getElementById("applyBtn").addEventListener("click", () => {
  const g = geneInput.value;
  if (!(g in DATA.gene_b64)) {
    alert("Gene not in panel. This page includes a selected panel (markers + top-by-mean) to keep it lightweight.");
    return;
  }
  geneU16 = decodeGeneU16(g);
  buildPlot();
});

[fltBroad, fltSubtype, fltRegion, fltTime, fltCond].forEach(el => {
  el.addEventListener("change", () => buildPlot());
});

buildPlot();

const plotDiv = document.getElementById("plot");
plotDiv.on("plotly_selected", updateSelectionSummary);
plotDiv.on("plotly_deselect", () => updateSelectionSummary(null));
</script>
